hotspots = json.loads(hotspots)


def getSpot (gene, residue):

	v = None

	for s in hotspots:
		if s["hugoSymbol"] == gene and s["residue"] == residue:
			v = s


	#print(v)

	out = ''

	if not v :
		out = 'no hotspot'
		return out

	out = '\n'.join([
		'Gene: ' + gene,
		'Residue: ' + residue,
		'Type: ' + v["type"],
		'Variants: ' + json.dumps(v["variantAminoAcid"]),
		'Samples: ' + str(v["tumorCount"])
		])
	return out

